    render() {
        const cardComponent = robots.map((user,iter) => {
            return <Card id={robots[iter].id} name={robots[iter].name} email={robots[iter].email} photo={'This is A Photo'} />
        })
        return (
            <div>

                {cardComponent}


            </div>





        )
    }
}

export default CardList
